
--View_HFit_GroupConfiguration ------
Select userguid,siteguid, accountid, accountcd, changetype, feature, membershipname, itemcreatedwhen, count(0)  cnt 
from View_HFit_GroupConfiguration
group by userguid,siteguid, accountid, accountcd, changetype, feature, membershipname, itemcreatedwhen
having count(0)>1

--View_HFit_FeatureConfiguration
Select SiteGUID, Feature, ValidFromDate, ValidToDate, AlwaysActive, AccountID, AccountCD, ChangeType, ItemCreatedWhen,  count(0)  cnt 
from View_HFit_FeatureConfiguration
group by SiteGUID, Feature, ValidFromDate, ValidToDate, AlwaysActive, AccountID, AccountCD, ChangeType, ItemCreatedWhen
having count(0)>1

